      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NOT ( col2 * - + col0 * - col2 NOT IN ( 99, - col1, - - 45, 54, 37 + - + col0 + - col2 * ( + ( 74 ) ) ) ) );
  - name: tab2

outputs:
  - name: q6729.out
    data: |
      46	51	23
      64	77	40
      75	67	58
